  return (
    <div className="events-container">
      <h1>Events List</h1>
      {eventList.length > 0 ? (
        <h1>Vikas</h1>
      ) : (
        <>
        <div className="list-container">
          <h1>No Events</h1>
          </div>
          <Link className="btn" type="submit" to="/upload-event-data">
        Click Here to Add Events
      </Link>
      </>

      )}


    </div>
  )
}

export default EventsList
